    "policyType": "BuiltIn",
    "mode": "All",
    "description": "This policy will audit that the specified application is not installed inside Linux virtual machines. This policy should only be used along with its corresponding deploy policy in an initiative/policy set. For more information on guest configuration policies, please visit http://aka.ms/gcpol",
    "metadata": {
      "category": "Guest Configuration"
    },
    "policyRule": {
      "if": {
        "allOf": [
          {
            "field": "type",
            "equals": "Microsoft.GuestConfiguration/guestConfigurationAssignments"
          },
          {
            "field": "name",
            "equals": "not_installed_application_linux"
          },
          {
            "field": "Microsoft.GuestConfiguration/guestConfigurationAssignments/complianceStatus",
            "notEquals": "Compliant"
          }
        ]
      },
      "then": {
        "effect": "audit"
      }
    }
  },
